import React from 'react';
import '../../../css/about.css'

function About(){
    return (
        <div>
            <h1> About Me </h1>
            <img className='picture' src="https://media-exp1.licdn.com/dms/image/C5603AQG0yHheBZOYhw/profile-displayphoto-shrink_800_800/0/1516151657250?e=1667433600&v=beta&t=xdLJ6F9LAyI3Ts4b3Xbfmd3jFpb46f6N-fYjMICRqJI"></img>
            <p className='about'>
                Hello! My name is Vincent Tate and I am a junior developer starting out my new adventure into the field. I come from a long background of leadership and face to face customer service and looking for something new in my career path. 
                I am really excited about working as a full stack developer and searching for a position that will challenge and my skill set. Hope to work with other driven individuals that feel the same way and who can help me to be a better developer
                as well.
            </p>
        </div>
    )
}

export default About;
